import React from "react";

const ListItem = () => {
  return (
    <>
      <li value={e.id}>
        {e?.childs?.length ? (
          !toggleList[e.id] ? (
            <FaPlusSquare
              style={{
                fontSize: "0.75rem",
                paddingRight: "0.25rem",
                cursor: "pointer",
              }}
              onClick={() => onToggle(e.id)}
            />
          ) : (
            <FaMinusSquare
              style={{
                fontSize: "0.75rem",
                paddingRight: "0.25rem",
                cursor: "pointer",
              }}
              onClick={() => onToggle(e.id)}
            />
          )
        ) : null}
        {e.name}{" "}
        <FaTrash
          style={{
            cursor: "pointer",
            float: "right",
            marginRight: "40rem",
            fontSize: "0.75rem",
          }}
          onClick={() => {
            const delKey = parent ? parent : "";
            deletekey(delKey, e.name);
          }}
        />
      </li>
    </>
  );
};

export default ListItem;
